('B-6D5Tp6YjQZKrjK4pz0ZWhdBFjrvjX_',1758439541,'{\"cookie\":{\"originalMaxAge\":604800000,\"expires\":\"2025-09-21T07:25:41.246Z\",\"secure\":true,\"httpOnly\":true,\"path\":\"/\",\"sameSite\":\"none\"},\"songData\":{\"Artist\":\"Player\",\"Title\":\"Baby Come Back\",\"Lyric\":\"Spending all my nights, all my money going out on the town\\nDoing anything just to get you off of my mind\\nBut when the morning comes, I\'m right back where I started again\\nAnd tryin\' to forget you is just a waste of time\\nBaby come back, any kind of fool could see\\nThere was something in everything about you\\nBaby come back, you can blame it all on me\\nI was wrong and I just can\'t live without you\\nAll day long, I\'m wearing a mask of false bravado\\nTrying to keep up a smile that hides a tear\\nBut as the sun goes down, I get that empty feeling again\\nHow I wish to God that you were here\\nBaby come back, oh baby, any kind of fool could see\\nThere was something in everything about you\\nBaby come back, you can blame it all on me\\nI was wrong and I just can\'t live without you, oh\\nNow that I put it all together, oh, oh\\nGive me the chance to make you see\\nHave you used up all the love in your heart?\\nNothing left for me? Ain\'t there nothing left for me?\\nBaby come back, oh darling, any kind of fool could see\\nThere was something in everything about you\\nBaby come back, listen baby, you can blame it all on me\\nI was wrong and I just can\'t live without you\\nI was wrong and I just can\'t live\",\"YouTube\":\"https://youtu.be/RO0oMjjwvmo?feature=shared\"},\"user\":{\"userId\":2,\"social_id\":\"3862520127\",\"social_provider\":\"kakao\",\"name\":\"임경륜\",\"visitCount\":4,\"mostVisitedDays\":\"Sunday\"}}'),
